style.css:
@-moz-document domain("roblox.com") {
/* Profile Page Base Code*/
/*Colour of the Boxes*/
.section-content.profile-header-content.ng-scope, .rbx-tabs-horizontal .nav-tabs *, .profile-avatar-mask, .section.layer.profile-collections.ng-scope, .switcher *, .section.profile-statistics .section-content
   {
     background-color:#183577!important;
   }
.section-content.profile-header-content.ng-scope *, .rbx-tabs-horizontal .nav-tabs *, .profile-container .asset-item, .switcher *, .section.profile-statistics .section-content *, .profile-about *
   {
     color:white!important; 
   }
/*End of the Boxes*/
/*Profile Avatar Viewer*/
.profile-avatar-left
   {
     background:transparent!important;
   }
/*End of the Avatar Viewer*/
/* End of Profile Page Base Code*/
/* Catalog Page Base Code*/
/*Creator Text*/
.creator-name.text-link, .text-robux-tile
   {
     color:white!important;    
   }
/*End of Creator*/
/*Topics*/
.topic.ng-binding.ng-scope
   {
     background-color:#183577!important;
     color:white!Important;  
   }
/*End of Topics*/
/*Search Filters*/
.search-options.ng-scope *, .text-link.breadcrumb-link.ng-binding
   {
     color:white!important;    
   }
/*End of Search Filters*/
/*Category Options Dropdown*/
.input-dropdown-btn.category-options.ng-scope
   {
     color:white!Important;
     background-color:#183577!important;
   }
/*End of Options Dropdown*/
/*Catalog Searchbar*/
.catalog-container .search-container .input-group .search-input, .catalog-container .search-container .input-group .autocomplete-dropdown-menu .dropdown-menu
   {
     background-color:#808080e3!important;    
     border-color: #808080!important;
     border-radius:5px!important;
     color: #183577!important;
   }
/*End of Searchbar*/
/*Item Description*/
.item-details *:not(.btn-growth-lg)
   {
     color:white!important;
   }
/*End of Description*/
/*Item Comment Section*/
.section-content.AddAComment 
   {
     background-color:#183577!important; 
   }
/*End of Comment Section*/
/*Price Chart*/
.section-content.price-volume-charts-container
   {
     background-color:#183577!important; 
   }
/*End of Price Chart*/
/*End of Catalog Page Base Code*/
/* Game Page Code */
/*Voting/Favourite/Follow Panel*/
.favorite-follow-vote-share *
   {
     color:white!important;
   }
/*End of Panel*/
/*Game Description*/
.text.game-description.linkify, .age-rating-details.col-xs-12.section-content *, .age-recommendation-title
   {
     color:white!important;
     font-weight:550;
   }
/*End of Description*/
/*Game Stats*/
.border-top.border-bottom.game-stats-container.follow-button-enabled, .age-rating-details
   {
     background-color:#1835779c!important;
   }
.border-top.border-bottom.game-stats-container.follow-button-enabled *
   {
     color:white!important;
     font-weight:1000;
   }
/*End of Game Stats*/
/*Servers/Badges*/
.create-server-banner.section-content.remove-panel *
   {
     color:white!important; 
     border-color:white!important;
     font-weight:600;
   }
.stack-row.badge-row.ng-scope, .badge-image *, .para-overflow.ng-binding, .badge-stats-container *, .btn-full-width.btn-control-sm.ng-binding, .section.tab-server-only *, .section-content-off.empty-game-instances-container, .rbx-game-server-item *, #sort-select, .input *
   {
     background-color:#183577!important; 
     color:white!Important;
   }
.section-content-off.empty-game-instances-container *, .btn-more.rbx-refresh, .server-list-options *
   {
     color:white!important;    
   }
/*End of Server/Badges*/
/*Gamepasses*/
.container-list.game-dev-store.game-passes *
   {
     color:white!important;
   }
.store-card-footer
   {
     background-color:#183577!important;
     border-radius:10px;
   }
/*End of Gamepasses*/
/* Global Base Code by DittoDino/BoopBop*/

/*Ads be gone*/
#navigation:after {	position: absolute !important; 	content: "Updated Base Code by @dinodabtuf" !important;	bottom: 5px !important;	left: 10px !important;	font-size: 8px !important;} .footer-note:after{content: " Hey there, this is a little secret from BoopBop/DittoDino or @dinodabtuf, the creator of this style's base code you're using."} .ad, .ad *, .img_ad, .ad-annotations, #google_image_div, #aw0, #AdvertisingLeaderboard, .abp .UpsellAdButton, .abp .UpsellAdButton:link, .abp .UpsellAdButton:visited, .abp .BadAdButton, .abp .BadAdButton:link, .abp .BadAdButton:visited, .abp .ad-identification-text, a.ad img, .abp, .profile-ad, #TopAbpContainer, .ad-annotations, #LeftGutterAdContainer, #RightGutterAdContainer, #Skyscraper-Adp-Right, #Skyscraper-Adp-Left, .abp-spacer, #GamesListContainer1 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-even, #GamesListContainer1 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-odd, #GamesListContainer8 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-even, #GamesListContainer8 > div.games-list > ul > div.abp.in-game-search-ad.dynamic-ad.ad-order-odd, .sponsored-game, .alert-info, #mCSB_1_container > ul > li.font-bold.small, #mCSB_1_container > ul > li.rbx-nav-sponsor,.banner-container, #dialogs-minimize /* This base code was made by DittoDino aka BoopBop, this is a form of credits to indicate who copied this code. */
   {
     visibility: hidden;
     background-color:transparent;
   } 

/*End of Ads*/

/*Colour Customisation (I don't use American spelling)*/
/* Header*/
.rbx-navbar *, .rbx-header
   {
     color:white!important; 
     background-color:#183577!important;
     border-color:#183577!important;
   }
/*End of Header*/
/*Top Searchbar*/
.navbar-search *, .rbx-header .navbar-search .new-dropdown-menu 
   {
     background-color:#0b2937a1!important;    
     border-color: #18597770!important;
     border-radius:5px!important;
     color: white!important;
   }
/*End of Searchbar*/
/*Sidebar*/
#navigation
   {
     background-color:#1835778f!important;    
   }
.left-col-list *:not(.notification)
   {
     color:white!important;    
   }
.left-col-list *:not(#upgrade-now-button)
   {
     color:white!important;    
   }
/*End of Sidebar*/
/*Footer*/
.container-footer, #footer-container *
   {
     background-color:#183577!important;
     color:white!important;
   }
#footer-container *
   {
     color:white!important;  
   }
/*End of Footer*/
/*Chat*/
.chat-body, .chat-friend-info *, .chat-windows-header, .dialogs *
   {
     background-color:#183577!important;
     color:white!important;
   }
/*End of Chat*/
/*Dropdown Menus*/
.dropdown-menu, .place-container, .people-info-card-container .interaction-item,  #notification-stream-container *
   {
     background-color:#183577!important;  
     color:white!important;
   }
/*End of Dropdowns*/
/*Header Text*/
h1, h2, .game-card-name, .item-card-name, .friend-name, .btn-secondary-xs.btn-more.see-all-link-icon.ng-binding, .text-name, .text-robux-lg, .btn-secondary-xs.see-all-link-icon.btn-more
   {
     color:white!important;    
   }
/*End of Headers*/
/*Like/dislike ratio and player count*/
.vote-percentage-label, .playing-counts-label
   {
     color:white!important;    
   }
/*End of ratio and player count*/
/*Colour Customizaton Ends*/

/*Background*/
body, .content
   {
     background:transparent!important;
   }
.dark-theme, .light-theme, .nav-content
  {
     background-position:top !important;
     width: 100% !important;
     height: 100% !important;
     background-size: cover !important;
     background-attachment: fixed !important;
     background-image: url("data:image/jpeg;base64,")!important;
  }
/*End of Background*/
/*Global Code Ends Here*/
}
